import p5 from "p5";

class Line {
  public startPoint: p5.Vector;
  public endPoint: p5.Vector;
  /**
   *
   * @param startPoint - 始点
   * @param endPoint - 終点
   */
  constructor(startPoint: p5.Vector, endPoint: p5.Vector) {
    this.startPoint = startPoint;
    this.endPoint = endPoint;
  }
}

const sketch = (p: p5) => {
  // x軸とするライン
  let leftLineX: Line[] = [];
  let rightLineX: Line[] = [];
  // y軸とするライン
  let leftLineY: Line[] = [];
  let rightLineY: Line[] = [];

  p.setup = () => {
    p.createCanvas(p.windowWidth, p.windowHeight, p.WEBGL);
  };

  const drawGrid = (z: number = 0) => {
    // x軸は線を横にする必要があるのでy軸をループさせる必要がある。
    const LOOP_MAX_Y = p.height;
    /// 左x軸の出力
    const LEFT_MAX_X = 0.0;

    for (let count = (-1 * p.height) / 2.0; count < LOOP_MAX_Y; count += 100) {
      let startPoint = p.createVector(LEFT_MAX_X, count);
      let endPoint = p.createVector((-1 * p.width), count);
      leftLineX[count] = new Line(startPoint, endPoint);
      p.strokeWeight(1.0);
      p.beginShape(p.LINES);
      p.stroke("#ffffff");
      p.vertex(leftLineX[count].startPoint.x, leftLineX[count].startPoint.y, z);
      p.stroke("#ffff00");
      p.vertex(leftLineX[count].endPoint.x, leftLineX[count].endPoint.y, z);
      p.endShape();
    }

    /// 右x軸の出力

    const RIGHT_MAX_X = 0.0;
    for (let count = (-1 * p.height) / 2.0; count < LOOP_MAX_Y; count += 100) {
      let startPoint = p.createVector(RIGHT_MAX_X, count);
      let endPoint = p.createVector(p.width, count);
      rightLineX[count] = new Line(startPoint, endPoint);
      
      p.strokeWeight(1.0);
      p.beginShape(p.LINES);
      p.stroke("#ffffff");
      p.vertex(rightLineX[count].startPoint.x, rightLineX[count].startPoint.y, z);
      p.stroke("#ffff00");
      p.vertex(rightLineX[count].endPoint.x, rightLineX[count].endPoint.y, z);
      p.endShape();
    }

    // y軸は線を縦にする必要があるのでx軸をループさせる必要がある。
    const LOOP_MAX_X = p.width;

    /// 左y軸の出力
    const LEFT_MAX_Y = (-1 * p.height);
    for (let count = 0.0; count > -1 * LOOP_MAX_X; count -= 100) {
      let startPoint = p.createVector(count, LEFT_MAX_Y);
      let endPoint = p.createVector(count, LEFT_MAX_Y * -1);
      leftLineY[count] = new Line(startPoint, endPoint);
      p.strokeWeight(1.0);
      p.beginShape(p.LINES);
      p.stroke("#ffffff");
      p.vertex(leftLineY[count].startPoint.x, leftLineY[count].startPoint.y, z);
      p.stroke("#ffff00");
      p.vertex(leftLineY[count].endPoint.x, leftLineY[count].endPoint.y, z);
      p.endShape();
    }

    /// 右y軸の出力
    const RIGHT_MAX_Y = (-1 * p.height);
    for (let count = 0.0; count < LOOP_MAX_X; count += 100) {
      let startPoint = p.createVector(count, RIGHT_MAX_Y);
      let endPoint = p.createVector(count, RIGHT_MAX_Y * -1);
      rightLineY[count] = new Line(startPoint, endPoint);
      p.strokeWeight(1.0);
      p.beginShape(p.LINES);
      p.stroke("#ffffff");
      p.vertex(rightLineY[count].startPoint.x, rightLineY[count].startPoint.y, z);
      //p.stroke("#ffff00");
      p.vertex(rightLineY[count].endPoint.x, rightLineY[count].endPoint.y, z);
      p.endShape();
    }
  };

  p.draw = () => {
    p.background(0, 0, 0);
    //p.orbitControl();
    p.push();
    p.translate(0, 0);
    p.rotateY(p.millis() * 0.0005);
    for (let count = 0; count > -1 * p.width / 2.0; count -= 100) {
      drawGrid(count);
    }
    p.pop();
  };
};

new p5(sketch);
